Comment prendre les mesures d'oxygène dans le sang :
 1. Portez la montre à une largeur de doigt en dessous de l'os du poignet, dans une position confortable sur votre poignet ;
 2. Une fois en mode test d'oxygène dans le sang, restez immobile, en vous assurant que votre poignet est plat et que la montre est orientée vers le haut. Si vous êtes assis, vous pouvez placer votre bras sur la table avec la montre vers le haut ; 
 3. Gardez votre bras stable jusqu'à ce que vous obteniez vos résultats finaux.
